INSERT INTO `c1_gallery_category` VALUES (24,'Kalichaur Temple','It is a famous pilgrimage centre of Goddess Kali and is in proximity to the rail head Kathgodam. The devotees from all over the country have an unflinching faith on her and she is worshipped for her gracious as well as the terrifying aspect. The priest Hari Dutt Sharma is of the view that the Sapt Rishis sojourned here and through spiritual powers attained by worshipping Kali they could achieve the Sapt Lok. The sage Markandeya also undertook penance here and created a sensation in heaven with his spiritual powers. Vishrawa father of Lankapati Ravana offered penance here to achieve the higher goal of realisation. (Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-24 14:26:10'),(25,'Shani Temple','The worship of Shani is of recent origin in Kumaon and it came in vogue through people who have migrated here from different parts of the country. His temple in Ranibagh is the first Shani temple in Kumaon as contented by his devotees. The temple is beautifully embellished with the \'nav grahas\' or the nine planets and statues of Shiva and Hanuman.\r\nThe evil impact of Shani is thwarted in the temple of Ranibagh by holding community prayers and by partaking community food on every Saturday. In the temple the idols of Hanuman and Shiva are propitiated because their worship is the panacea for the harsh impact of the unfavourable presence of Shani. (Content by Ajay S. Rawat)\r\n',1,'2017-07-24 14:28:32'),(26,'Ranibagh','Ranibagh is an ancient pilgrimage centre and the gateway to Kumaon, people take a sacred bath on the confluence of rivers Gargi (Gaula) and Pushpbhadra. According to tradition Rani Jiya of the Katyuri dynasty which ruled Kumaon and Garhwal arguably from 500 AD – 1200 AD undertook penance here on the sacred rock Chitrashila, referred to in Skanda Purana and attained divine knowledge. Another relic of the illustrious Katyuri period is the temple of Lord Shiva now popular as ‘Shaktipeeth.’ Rani Bagh is a great pilgrimage centre; here religion is a transforming experience where the individual withdraws his soul from all outward events and strives with concentration to connect himself with a joyous sense of divine gratitude. (Content by Ajay S. Rawat)\r\n',1,'2017-07-24 14:31:10'),(27,'Jeolikote ','Beyond Patwadangar on the Haldwani road is Jeolikote. It is an educational centre and a tourist destination. The countryside is serene and beautiful. Here one comes across a quiet haven where Nature sings the peace of life and the feathered inhabitants there are a visitors’ delight.\r\nJeolikote is known for the famous school, St. Anthony\'s Convent established in 1895 for children with a humble background. In 1906 St. Anthony’s Catholic Church was established, here one perceives that individual emancipation is much lower an aspiration than working for the deliverance of all human beings. \r\nIt is also famous for the Government Apiary Centre. It was established in 1938 by Rajendra Nath Mutto for providing knowledge to the villagers on bee keeping to supplement their income. \r\n(Content by Ajay S. Rawat)',1,'2017-07-24 14:34:02'),(28,'St. Michael Church Bana','St. Michael Church is elegantly located in village Bana near Patwadangar. Bana is an old Catholic Mission, which constitutes the three villages of Bana, Luchisani and Mona. It was started in 1928 and the people used to congregate there in a wooden chapel. It was converted into a large church in 1936 and a parish house was built there in 1947. Currently the Parish priest of Jeolikote Mission takes care of the pastoral needs of the people of Bana Mission. (Content by Ajay s. Rawat)\r\n',1,'2017-07-24 14:37:06'),(29,'Patwadangar','It is an upcoming tourist centre surrounded by pine forests. It is an ideal spot for forest bathing where people can walk small distances inside forests, sit and enjoy their serenity and unwind themselves. Forest bathing is ideal for reducing stress and rejuvenating every part of the body.\r\nPatwadangar is situated on the Nainital Haldwani road. The name Patwadangar is an appellation of the Patwa Plant which according to the common belief flowers in abundance during the rainy season in this region. It is famous for the State Vaccine Institute which was established here in 1903 and for several years served the country. On 9th October 2005 it was transferred to the GB Pant University of Agriculture and Technology for hands on training programmes in frontier areas of bio technology in diverse scientific fields like medical sciences, veterinary, agriculture, immunology etc. (Content by Ajay S. Rawat)\r\n\r\n',1,'2017-07-24 14:39:51'),(30,'Nag Karkotak','Ensconced on a hill top and overlooking the lakes of Bhimtal and Naukuchiyatal, is the ancient temple of Nag Karkotak, the snake God. He is one of the most powerful snakes with numerous magical powers. His parents were Sage Kashyap and Kadru the daughter of Daksha, one of the sons of Lord Brahma. Kadru is described in the Vedas as the mother of all snakes. According to the legend, Karkotak had been cursed by sage Narada. However as had been predicted he was relieved from the curse by King Nala of the Nishada Kingdom. Nala\'s spouse was the beautiful princess Damayanti. In close proximity to Sat Tal is the Nal Damayanti Tal, which is regarded as very sacred by the local inhabitants. \r\nEnroute to Nag Karkotak is the famous Ashram of Sage Dattatreya, which attracts the pious. He has attained a coveted position in Indian scriptures because of his knowledge which was not imparted to him by any teacher or sage. His teacher was Nature and during his perambulations as a Sanyasi whatever he observed in Nature was knowledge for him and these natural observations were his 24 teachers. Dattatreya is revered as the \'Adi Guru\' (First teacher) of the Adi Nath Sampradaya. The sages of this sect lived alone in caves, huts, ruined buildings or empty houses until they attained their goal. Adinath is a synonym of Lord Shiva, who is beyond mental concepts and is the supreme reality.\r\n(Content Courtesy Ajay S. Rawat)',1,'2017-07-24 14:48:31'),(31,'Naukuchiya Tal','A pretty lake with its nine corners is a captivating site. It is a\r\nparadise for anglers and a haven for migratory birds. The water is\r\ncool and inviting and swimming is a rare pleasure in this beautiful\r\nlake. In Naukuchia Tal there is a famous temple of Lord Hanuman and\r\nthe Ashram of Mauni Ma a great saint who took ‘samadhi’ in the recent\r\npast. She used to observe total silence and on rare occasions\r\ncommunicated with her devotees through writing or with sign language.\r\nToday it is a great pilgrimage centre for the devotees of Lord Hanuman\r\nand the followers of Mauni Ma.\r\nContent By Ajay S. Rawat',1,'2017-07-24 14:50:13'),(32,'Sat Tal','Unique, unforgettable, one is apt to run short of superlatives to describe the unsurpassed spectacle of the constellation of these lakes. It has to be seen to be believed. These picturesque lakes are a paradise for the anglers, swimmers and bird watchers.  (Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-24 14:52:27'),(33,'Methodist Ashram','It is situated at the entry point of Sat Tal Lake area. Unspoilt by material world, Sat Tal since time immemorial is considered sacrosanct. There are seven hill tops above the valley and the charming legend accounts for the suitable name it bears. In the hoary past as believed, a village woman while visiting the neighbouring forest to pick fallen twigs and branches revived an old man who was dying of thirst. She brought water for him from the nearby spring seven times in her cupped palms. The old man who was very pleased blessed her and said for every drop of water a lake will be formed. \r\nIn 1930 Dr. Eli Stanley Jones established the Christian Ashram in Sat Tal. It was one of the first of its kind in India and was both Christ-centered and Church-centered. The Sat Tal Ashram is imbued with an Indian perspective of simple living and high thinking and is a creative way to bring all Christian denominations in unity and deeper Christian Fellowship in Holy Spirit.\r\nDr. Jones came in contact with Gandhi ji through Rev. C. F. Andrews which drew him to the Indian freedom struggle. He became an ardent supporter of the Non Cooperation and Non Violence Movements. He was a good writer and 29 books flowed from his eloquent pen. Most of his books have achieved international recognition. In 1959 he was named Methodist of the Year. He was nominated twice for the Nobel Peace Prize and in 1963; he was awarded the Gandhi Peace Prize.\r\n(Content Courtesy Ajay S. Rawat)',1,'2017-07-24 17:30:14'),(35,'Bhim Tal ','Ensconced at a distance of almost 22 km from Nainital, Bhim Tal is one of the most popular destinations today. The pride of the town is the beautiful lake, which offers magnificent vistas for the tourists. The State of Art Aquarium housed on the island in the middle of the lake together with paragliding and trekking offer tempting prospects to the sight seers and the adventure seekers. In Bhimtal beauty reveals history. On the shore of the lake is sited the ancient temple of Bhimeshwar Mahadeo and on the top of the ridge overlooking Bhimtal and Naukuchiyatal is the shrine of Nag Karkotak, where every stone tells a story.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-24 17:36:39'),(36,'Temple of Bhimeshwar Mahadeo','According to recorded history, Raja Baz Bahadur Chand, who is credited to have established the township of Bazpur in Udham Singh Nagar district, constructed the temple of Bhimeshwar Mahadeo in the 17th century. It is believed that Raja Nal who stayed in Nal Damayanti Tal near Sat Tal used to visit Chota Kailash daily to worship Lord Shiva. This Chota Kailash is ensconced above the village Baana in Nainital District. One day he got delayed owing to unforeseen weather and could reach BhimTal only at the auspicious moment. As it was not possible for him to negotiate the distance to Chota Kailash, he invoked Lord Shiva and prayed for forgiveness.\r\nShivji was very pleased with his devotion and appeared in the \'lingum form\' on the shore of lake. Later a temple was constructed on the spot. In the temple of Bhimeshwar Mahadeo, Lord Shiva is propitiated as the Supreme Reality. He is the lord of compassion who saves his devotees from suffering and also protects them from the evil forces of lust, avarice and anger and awakens wisdom in them.\r\nAs snakes are often associated with Shiva, a temple of Kainchuli Devi is believed to have existed inside the BhimTal Lake. Kainchuli Devi is the mother of Snake God Karkotak whose famous shrine is in the area. According to tradition snakes come to worship in Bhimeshwar Mahadeo and shed their skins in Kainchuli Devi Temple. In the recent past lake level of Bhim Tal came down very badly owing to lack of rains and people got the opportunity to have \"darshan\" of the Goddess in mid July. People from far and wide gathered there to have a glimpse of the temple. \r\nThe appearance of the temple had mixed reactions; people though enthralled with the emergence of the temple, were concerned about the ecological crisis dangling over the Lake Region. Subsequently a temple of Kainchuli Devi was constructed on the shore of the lake to remind the people of the macabre future looming large on humanity if over exploitation of water and other natural resources is not contained. (Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 07:36:22'),(37,'Durga Temple Dhaniakot.','The temple of Goddess Durga in Dhaniakot has emerged as a famous religious shrine today. It sits hidden in the midst of fields on the Khairna Betalghat road. The devotees have unflinching faith on her as the invincible warrior Goddess who killed the demon Mahisasura and also as Nature Goddess. They strongly feel that like in the past she will protect Nature from the demonic forces today. Whenever people wreak havoc on natural resources, she intervenes and inflicts punishment in the form of disasters.\r\nIn Kumaon Shakti has its origin deep rooted in the agricultural history of the region and is still manifested in many of its folk festivals. She is worshipped in Dhaniakot to secure protection from the wrath of Nature and to perceive the difference between greed and need.\r\n(Content Courtesy Ajay S. Rawat)\r\n',1,'2017-07-25 08:40:44'),(38,'Darmani Siltona','Beyond Khairna on Betalghat road is quietly ensconced the hamlet Darmani Siltona, popularly known as the paradise on earth. It is famous for its Himalayan views, bird watching and the popular and only guest house \'Junoon in the Hills\'. Hugging the mountains and with the spectacular views of Trisul and Nanda Devi, the guest house embodies what one yearns for, serenity and a sense of magical proximity to the immortal.\r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 08:46:37'),(39,'Khaireshwar Mahadeo','It is a known pilgrimage centre sited on the confluence of the rivers Kshipra and Kosi at Khairna. Pilgrims visit the place with a feeling of total surrender on Shivratri. The hidden treasure of divinity is unfolded here, which charters the path of devotees to the eternal abode of oneness, peace, tranquility and bliss. The township of Khairna is named after it. According to Raj Guru K.C. Suyal this area was famous for Khair (Acacia catechu) forests owing to which Lord Shiva was worshipped here as protector of Nature and the temple became famous in the local parlance as the shrine of Khaireshwar Mahadeo. \r\n(Content Courtesy- Ajay S. Rawat)\r\n\r\n',1,'2017-07-25 08:52:41'),(40,'Mukteshwar ','This place is a unique creation of Mother Nature and famous for the Indian Veterinary Research Institute which was first established as Veterinary Research Laboratory in Pune in 1885. Subsequently, it was relocated to Mukteshwar in 1893 to facilitate segregation and quarantine of highly contagious organisms. The salubrious climate, unpolluted natural environment and cold climate of Mukteshwar was found congenial for the preservation of vaccines and suitable for works on infectious micro-organisms. The noted Nobel Laureate Herman Robert Koch from Germany was invited here by the British Government for guidance. He was awarded the Nobel Prize in 1905.\r\nFamous for its apple orchards and magical scenery of Himalaya, it is a paradise of perfection for the sight seer. Here one steps into the water colours of Nature and the vast canvas of breath taking beauty which it has painted so beautifully.\r\n (Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 08:57:31'),(41,'Ramgarh ','A picturesque village in the heart of apple orchards, it offers a captivating site of the surrounding wooded county. Here in the mystique of the mountain mists and the swirling clouds that shroud the emerald valleys, one gets a chance to glimpse the magic of the snow clad Himalaya in their towering glory. \r\nThe museum of the famous Hindi poetess Mahadevi Verma is located here. She used to sojourn in Ramgarh during the summers and drew inspiration from the irresistible wonders of Nature. Rabindranath Tagore also spent some time in Ramgarh. He experienced oneness with Nature in the unsurpassable grandeur of forests and the silent walks through the hill \'Tiger Top\' fascinated him.\r\n (Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 08:59:50'),(42,'Gagar ','Elegantly situated between Mahesh Khan and Ramgarh, Gagar is known for its Himalayan view and a holiday in solitude. It is named after the famous rishi Garg who offered penance here. He was one of the greatest sages of the Puranic period who gave the name Krishna arguably to the reincarnation of Lord Vishnu. According to tradition he was a Brahmin but a branch of his scions converted to Kshatriyas and joined the Greek Army. Probably it could be one of the reasons that in later period Greek mathematicians and astronomers were referred to as Gargacharyas. \r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 09:02:28'),(43,'Mahesh Khan','Situated beyond Bhawali on the Ramgarh road is Mahesh Khan, a treasure trove of biodiversity. The beautiful forest bungalow is elegantly sited in the midst of forests and is a favourite haunt of Nature lovers and bird watchers. Mahesh Khan is a botanical marvel where wild flowers bloom, butterflies dance, the cool breeze whispers and Nature sings the peace of life. Enjoy the virgin forests of Mahesh Khan, a joy which would last long and its memories forever.\r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 09:07:11'),(44,'Bhowali ','During the British rule, Bhowali was known as a health resort and a hill fruit market. It is also famous for its TB sanatorium, which was established in 1912. Luminaries like Subhash Chandra Bose, Kamla Nehru, the famous singer Kundan Lal Sehgal, K. N. Katju, a leading statesman, writer Yashpal, Ali brothers (Mohammad Ali and Shaukat Ali), the eminent freedom fighters and leaders of the Khilafat Movement as well as noted writer and freedom fighter Gaya Prasad Shukla etc. were treated here. Kamla Nehru was treated in 1935 by Dr. Prem Lal Sah and Dr. K. K. Kakkar. Dr. Prem Lal Sah was very popular with the patients and Yashpal the writer has extolled him. Uttarakhand Judicial Academy a premier institution for training of officers from the judicial services is housed here. Beyond the Academy is Ghorakhal known for its Sainik School and the temple of Lord Golla, the God of Justice. People often go to his refuge for redressal when justice is denied to them by ordinary mortals and mundane courts. Thousand throng his temple for instant solace against injustice inflicted on them. People appeal to him on a letter or even a small piece of paper and when their wish is fulfilled they offer a brass bell. The countless number of bells, including that of a British officer and letters of appeal hanging in the temple, bear testimony to the faith of people. Close to the sacred shrine is the famous tea garden established by Kumaon Mandal Vikas Nigam. It has assumed great importance as a tourist spot. On the Ranikhet road near Bhowali is sited the premier institute National Bureau of Plant Genetic Resources. It was established in 1943 as an imperial Potato Research Station. Today it is known internationally for augmentation, evaluation, maintenance, regeneration, conservation and documentation of generic resources of medicinal and aromatic plants etc. The forests around the institute are very rich in wild life and an irresistible wonder for nature lovers and ornithologists.\r\n(Content Courtesy- Ajay S. Rawat)\r\n\r\n',1,'2017-07-25 09:18:15'),(45,'Corbett National Park ','Aptly called the land of roar, trumpet and songs, Corbett Park is a legend come alive. It is a showpiece of India\'s wildlife conservation. Quietly nestled at the foothills of the Himalaya it is a dream come true. The pride of the Corbett Park is the distinction of being the first National Park of India. It was established in 1936 and was named the Hailey National Park; after Sir William Malcolm Hailey, an enthusiastic conservationist who was at that time the Governor of United Provinces. It was rechristened in 1957 as the Corbett National Park in the memory of late Jim Corbett, legendary sports person, a great naturalist, eminent conservationist and prolific writer. He spent some of the best and happiest years of his life in Kumaon Himalayas. \r\nThe park embraces the picturesque Patli Doon in both Nainital and Pauri districts. The Ramganga River meandering its way through the park with some deep pools and foaming rapids form the main water source. The area of the park according to the Forest Department is 1318.54 sq km out of which the tourist zone is 520.82 sq km. \r\nCorbett National Park is regarded as India\'s finest National Park. It is essentially a low large valley. Over 52 mammals, 580 birds and 25 reptile species have been listed in the park. But the jewel of the park is Indian Tiger. “Project Tiger \" was launched here in 1973.\r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 09:24:31'),(46,'Garjiya Devi ','The famous temple on the outskirts of Ramnagar unveils the story of the prowess of Goddess Girija popular as Garjiya in the local parlance. Parvati is known by many names and as Girija or Girija Putri she is the daughter of mountains, the mighty Himalaya. She is the gentle aspect of Shakti and is usually represented as fair, benevolent and beautiful. Girija is the voice of encouragement, reason, freedom and strength as well as of resistance, power, action and retributive justice.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 09:29:05'),(47,'Sitabani ','Sitabani is elegantly seated in the vibrant forests of Ramnagar Forest Division. The shrine of Goddess Sita amidst wooded country is soothing, sublime and the soul of ‘Aranya Sanskriti’ the forest culture of India. In Sitabani the sands of time have left their indelible mark in the form of Valmiki Ashram. You would not forget the divine visit to this serene place and will long to come back again and immerse yourself in the sylvan environs. Goddess Sita sojourned here for a long period in Valmiki Ashram.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:05:28'),(48,'Corbett Fall','It is close to Kaladhungi towards Ramnagar and has been named after Jim Corbett. The lush green Forests of Corbett Fall, the cascading waters, their beauty and silence, wrap within them life, that is vibrant and pristine. The Forest Department has developed it as a rich centre of biodiversity and scenic grandeur. It is a representative area of the subtropical forests of the Himalayan region and provides a window to the Indian philosophy, which claims forests to be a living entity transcendental in nature. The Upanishads spoke of the need of restraint in the use of resources in order to protect the interest of our future generation.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:07:29'),(49,'Corbett Gram Vikas  Samiti (CGVS)','The legacy of Jim Corbett has been kept alive by Corbett Gram Vikas Samiti, Kaladhungi. Every year the organization with the help of the inmates of the village Choti Haldwani stage a play based on different episodes from Jim Corbett\'s famous book My India. The leading role is enacted by Tom Altar the Bollywood actor. CGVS has established a jungle camp in Choti Haldwani and is doing a yeoman\'s service in the ecotourism and have fostered an enduring relationship with the visitors. It is working with the villagers for environmental conservation. CGVS organises jungle camps, awareness campaigns on various environmental and conservation related issues and encourages tree plantation during monsoon. They organise home stays, bird watching and jungle trail of Jim Corbett starting from his museum to the Chaupal and various other places which are associated with his life. Moti House is one of the attractions. He built a masonry house for his childhood companion with three small rooms and a wide verandah to relieve him of the perennial problem of his hut which needed constant repair necessitated by violent storms that hit the region. The tourists also like to visit the masonry wall round the village, which is 1.71 m high and 4.83 km. It was built by Corbett to protect the crops of the villagers. A nature club of local students is also a part of Samiti’s activities for sensitizing villagers on wild life conservation.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:11:03'),(50,'Temple of Brahma Bubu ','The mystic call of the wild, the lush green scenery and the serenity of Brahma Bubu’s temple offers a free trip to Shangri-La. The shrine ensconced in the midst of vibrant forests on way to Kaladhungi is dedicated to the local deity Brahma Bubu. He is ‘Van Devta’, Lord of the Forests and devotees from Nalini, Mangoli, Kaladhungi, Kotabagh, Chakalwa and other places propitiate him after harvesting of wheat.  A grand ‘puja’ is held during that period in which farmers from various places attend the ceremony. As ‘Van Devta’ he takes care of fauna, flora and ensures the availability of food to human beings. He is also the protector of domestic animals and the peasants invoke him when their cattle are in distress. In the temple one can perceive the transcendental glory of the Almighty and the perfection of Nature.\r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 10:14:05'),(51,'Kaladhungi ','Jim Corbett spent most of his life here. Today the building where he stayed has been converted into a museum and his belongings there remind us of that great hunter and conservationist. Corbett purchased a small hamlet in the area called Choti Haldwani in 1915 in Kaladhungi for 1500 rupees from Guman Singh Barwa. Kaldhungi was Jim Corbett\'s winter home and he wanted to develop Choti Haldwani into a model village and settled some forty tenants there. After settling and providing houses to the tenants he also shifted to the village. Corbett lived like a patriarch there and took paternal care of the tenants to ensure their welfare. He had built a ‘Chaupal’ in the residence of Sher Singh Negi where Jim listened to the problems of the villagers and helped them. Sher Singh Negi was his childhood friend and a constant companion whom he presented a muzzle loader. Today the muzzle loader is with his son Trilok Singh Negi and a great attraction for the tourists who like to be photographed with him and the muzzle loader.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:16:24'),(52,'Khurpa Tal','Quietly ensconced on the Nainital- Kaladhungi road, this village is endowed with a beautiful lake. Its crystal clear waters and the surrounding fields and mountains open a new vista for the nature lovers. It was famous for potato cultivation and iron smelting during the 19th century. The sunset view from Lingh Dhar in close proximity is a rare spectacle. One can trek to Khurpa Tal from Nainital through one of the most beautiful cemeteries of the British period. The trek is about 5 km.(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:18:05'),(53,'Sariya Tal ','It is enroute to Khurpa Tal and a lake has been created there in the recent past. It was actually a wetland known as ‘Simar’ or ‘Gajar’ in the local parlance. Gajar is a marshy tract of land in an agricultural field and is created by the water table below. Cultivation of high quality crops like basmati rice, medicinal plants and herbs are a common feature. The medicinal plants normally grown in it are two varieties of brahmi (Centrala asiatica) and (Bacopa monnieri). The former is used as a memory tonic, as di-uretic and for curing leprosy. The latter is used as a nervine tonic and in asthma and diarrhoea. The other medicinal plants, which are congenial for cultivation in gajar are bach (Acorus calamus) and halung (Cardamine empatiens). The common use of bach is in dysentery, bronchial asthma and epilepsy and of halung in ulcer and colic pain. When potato cultivation was introduced in British Kumaon by Commissioner Kumaon, Sir Henry Ramsay during the 19th century, Sariya Tal was developed as an experimental garden In close proximity is a small water fall where beauty is etched on the lap of nature.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:20:43'),(54,'Kunj Kharak  ','Beyond Pangooth is Kunj Kharak which is again very rich in biodiversity. The misty hills, the sylvan surroundings, the towering Himalayas and the divine serenity weave a magical spell. The mountains standing like sentinels and the idyllic clouds floating atop whisper in your ears that you are the chosen spectator here and the blessed one to witness the glorious rainbow of life arched across the sky.\r\n (Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:22:30'),(55,'Vinayak ','Sitting on the route beyond Pangooth, Vinayak is known for its vibrant forests and the quaint forest bungalow. It has a spectacular wilderness and a stroll through its sylvan environs is a must have experience.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:23:46'),(56,'Pangooth ','In close proximity to Kibury is Pangooth village and forest area. It is a unique creation of Mother Nature. The Ramkrishna Sarda Mission is housed here, which came into existence on 19th October 2003 to promote Vedanta in all its phases. It was established with the help of Janet (Jenny) Cochius, Jeanne Baker, Sujata Leemans of Holland and Pravrajika Viveka Prana.  Group retreats are organized here at regular intervals for formal study of scriptures.\r\nPangooth with its camping sites is an ideal place for trekkers, bird watchers and nature lovers who want to spend their holidays in peace and solitude.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:26:02'),(57,'Kilbury ','Quietly ensconced at a distance of 10 km by road from Nainital, Kilbury is the sanctum sanctorum of biodiversity and a Conservation Reserve. Encompassed by mountains it opens a whole new vista of the snow clad peaks of the Himalaya in their bewitching splendour. One can spend the night there in the forest rest house and its sylvan surroundings are an ideal spot for a quiet and peaceful holiday. The sunset views in different seasons from Kilbury are mesmerizing. \r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:27:51'),(59,'Aries ','On the same ridge as the Hanuman Garhi temple is located ARIES ( Aryabhatta Research Institute of Observational Sciences). It is a centre of astronomical studies and optical tracking of artificial satellites. ARIES which also signifies the zodiacal sign of sun has made significant contribution in several areas of astronomical research, particularly those involving time critical phenomenon. ARIES is very popular with the tourists for night gazing of the sky.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:31:15'),(60,'Nainital Zoo ','Elegantly situated on Sher Ka Danda ridge, Bharat Ratna Govind Ballabh Pant  High Altitude Zoo was established in 1995 with the objective of conserving and protecting the wild life and biodiversity of Uttarakhand. It is involved in several activities such as pheasant breeding programmes, animal adoption schemes, giving refuge to injured fauna in the wild, panda breeding and zoo outreach activities to create awareness towards wild life conservation. It is one of the best maintained zoos in the country and an ecological paradise.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:33:03'),(61,'Cave Garden ','Situated next to the Kumaon Mandal Vikas Nigam’s rest house on the Kaladhungi road, cave garden is attracting a large number of tourists. It is constructed inside natural caves and the scene unfolding inside the ecological window of this marvel is waiting to receive you.\r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 10:34:29'),(62,'Raj Bhawan ','The best and the most beautiful building constructed in the 19th century in NainiTal and a tourist’s delight is the present Governor’s house. Its foundation stone was laid on 27th April, 1897 and the building was completed in March 1900. The architecture is early Gothic style and the general effect of the building is one of solidity and dignity without exuberance. It has an old golf course with 18 holes, one of the best golf courses in Northern India. For draining out the water from the golf course, an underground tunnel 137.1m in length has been constructed which is a marvel in engineering. The area of Raj Bhawan is 82 ha chiefly of hills and forests and has been designed after the famous Buckingham Palace. The Raj Bhawan has a rich collection of 19th and 20th century weapons, including weapons of the legendary Sultana Daku, popularly known as Robinhood of India, elephant tusks and other trophies.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:36:51'),(63,'Aurobindo Ashram','It is nestled above Bara Patthar in an ancient building, ‘Ben Awiss.’ The mission was established in 1966 under the umbrella of Sri Aurbindo Ashram, New Delhi by Sri Surendra Nath Johar with the assistance of Sri Chandra Lal Sah Thulgharia. With myriad facets of Indian tradition, it is bedrock of Indian culture and philosophy and is sanctified with youth camps, yoga classes, art of living programmes, lectures as well as brain storming sessions on spiritualism. The visitors are treated to an incomparable view of the setting sun and the scenery is particularly breathtaking when the clouds cover the valley below with cotton like padding.\r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 10:38:35'),(64,'Hanuman Garhi ','The famous Hanuman temple, which is sited at a distance of 3.22 km from Nainital on the Haldwani road, was constructed by the legendary saint of the 20th century Neeb Karauri Baba. He was divine incarnate and humanity saw in him an all pervading, an all knowing and all powerful being whose love opened the doors that lead to perennial bliss and divine beauty.\r\nHanuman Garhi temple is very famous for its sunrise and sunset views and for the surreal designs that clouds weave during the rainy season. The temple is surrounded by a rich forest and is a haven for bird watching and wild life.\r\n (Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:40:14'),(65,'Pashan Devi ','The tradition of the temple is interwoven with G.W.Traill, the second Commissioner of Kumaon. He was a highly realized soul. Once while going on horseback through South Mall or Thandi Sadak he heard the distinct chiming of bells. Traill immediately alighted from the horse and proceeded to the point from where the sound emanated. He took off his shoes and prostrated in front of the rock where the image of Goddess Durga was engraved. Subsequently he approached the local villagers and at his behest a temple was constructed there. Today it is a great centre for spiritual guidance for the seeker. Here one can clearly visualize how Nature supplies spiritual sustenance which makes the spirit soar with the divine and the energies are marshalled in pursuit of the higher truth.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:42:36'),(66,'Lake Church','Another important church of the period is St Francis Catholic Church sited towards the lower side of the lake. It is popularly known as the Lake Church and was built in 1868 by Rev. Father Macen of the Vicarate of Agra. It was dedicated to St. Francis of Assisi. Later on the Lake Chapel proved small for the increasing congregation and hence construction of the present building of church began in 1907. It was completed and blessed on 23rd May 1909 by the Archbishop of Agra, Rev. Charles Gentili. The charm of the church is its simplicity and the ambience of the quiet engenders here to understand that mundane possessions make life more complicated.\r\n (Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:44:21'),(67,'St. Nicholas Church ','Close to the entry point of Raj Bhawan is one of the most beautiful Protestant churches of the State. Its foundation stone was laid in 1890 and consecrated in 1896 by Rev. Bishop Alfred Clifford and Sir Auckland Colvin, the Lt Governor of North Western Provinces. The structure of the church is very imposing where light seems to triumph over substance. It is a home of peace and praise to the Almighty where one can perceive the transcendental glory of God. \r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 10:45:43'),(68,'First Methodist Church of India ','The construction of the church was started in 1858 and dedicated to the people in October, 1860. It was established by an American missionary, William Butler with the help of Sir Henry Ramsay, the legendary Commissioner of Kumaon (1856-1884). William Butler came to Calcutta on 22nd September 1856. When he stepped on the Indian soil, the political climate was not congenial for missionary work. After visiting several places in India, he settled down in Bareilly in 1857. He had scarcely begun work when the news of conflagration in Meerut reached Bareilly. On 14th May he fled and took refuge in Naini Tal, a safe haven for Europeans. His dream came true in the hill town and today the church has been declared as heritage site. Every year thousands of devotees and tourists visit the holy place to listen to deepest wisdom of their souls. The charm of the church is its simplicity.\r\n(Content Courtesy- Ajay S. Rawat) ',1,'2017-07-25 10:49:10'),(69,'St. John’s in the Wilderness','One of the earliest buildings, a poetry written on stone that was erected in NainiTal was the church St John- in- the- Wilderness. The site was chosen as early as 1844 and approved by the Bishop of Calcutta, Daniel Wilson. The plans were prepared by Captain Young and the corner stone was laid in 1846. It was first opened on 2nd April 1848 and in 1856 it was taken over by the government as a public building. There are two very important memorials in the church. One commemorates those who died in the diabolic landslide of 1880 in Naini Tal and the other is of those members of the Indian Civil Service who were killed in the First World War. A visit to the church is an exhilarating experience because the mind in the blissful place does not deliberate between the domain of the past and the present or apprehensions of the future. It is devoid of the constant struggle that ensues in the mind of what is and what ought to be.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:51:40'),(70,'Arya Samaj Mandir  ','It is the first Arya Samaj of the country and was initiated as the Satya Dharma Prakashini Sabha in Naini Tal. Influenced by the philosophy of Maharishi Dayanand Saraswati, Pandit Gajanand Chimwal and his associates established this Sabha on 20th May 1874. On 7th April, 1875, when Maharishi Dayanand Saraswati established the Arya Samaj in Bombay, the members of the Satya Dharma Prakashini Sabha joined hands with the Arya Samaj. The present site of the Arya Samaj Mandir was allotted to it after Independence owing to the efforts of Thakur Jasod Singh Bisht, the then Chairman of the Municipal Board Nainital and R.B. Shivdasani, Commissioner of Kumaon those days.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:54:44'),(71,'Gurudwara Singh Sahab ','During the period when Raj Bhawan was under construction, Ramgarhia Sikhs from Punjab were specially invited for masonry work. They built the first Gurudwara in RajBhawan. Later in 1923 five Sikhs who were posted here in the Eastern Command shifted it from the wilderness of Raj Bhawan to Jai Bhawan in Talli Tal bazaar. In 1935, its location was again shifted to Malli Tal Bazaar and finally in May 1947, it was transferred to its present site.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:56:06'),(72,'Jama Maszid ','It was constructed arguably in 1865 and together with the Naina Devi temple, the Gurudwara, the Arya Samaj Mandir and the First Methodist Church of India, all in close proximity symbolizes communal harmony of the denizens of Naini Tal.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:57:08'),(73,'Naina Devi Temple ','Nestling snugly at the northern end of the lake is the Naina Devi temple. The left eye of Sati, the consort of Lord Shiva fell here and was sanctified as one of the 64 Shakti Peeths. The place was considered so sacred that Nag Karkotak, the snake God ordained that in the vicinity of Naini Tal, no one will die of snake bite.\r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 10:58:38'),(74,'Tibetan Market ','It is the shopping hub of the town. Blessed with the welcome touch of Tibetan hospitality, one gets good quality and reasonably priced products here.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 10:59:35'),(75,'Land\'s End ','The best feature of this spot situated beyond Bara Pathhar is that one does not have to climb much and as the name suggests, one feels on reaching there that the end of the land has really come. The view of the neighbouring hills, the valley and the setting sun behind Khurpa Tal is exquisite from this point. Horse riding is popular in the area and one can go on horse-back to Dorothy’s Seat through Lands End. The forest between Land\'s End and Dorothy Seat is very rich in biodiversity and one cannot be but in awe to experience the perennial bliss of Nature.\r\n(Content Courtesy- Ajay S. Rawat)\r\n',1,'2017-07-25 11:01:14'),(76,'Snow View ','It is the most easily accessible hill top. One can negotiate this distance on foot or through a ropeway. It affords as the name suggests, an indescribably beautiful picture of the snow clad peaks. In Snow View there is a beautiful temple of Lord Shiva where unfulfilled wishes and aspirations of the people are fulfilled in unseen intangible ways. Hugging the mountains, one can feel the closeness of the supernatural and the peace of mind transforms here into a kind of ecstasy evolving into an unconditional love for humanity at the higher levels.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 11:02:48'),(78,'Dorothy Seat ','Popularly known as Tiffin Top, it is a memorial to Mrs. Dorothy Kellet built by her husband. The road to this picnic ground crawls along the rugged hill side, and then in hushed silence suddenly unfolds a canvas on which Nature has painted this beautiful spot. Dorothy Seat commands an excellent view of the Himalaya and the neighbouring country side.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 11:05:53'),(79,'Naini Lake','The nucleus of Naini Tal\'s scenic beauty is her freshwater natural lake. It looks beautiful in the night when myriads of bulbs hanging from the hill sides and quite a large number on its shore shower their magical lights into the lake. This reflection alone holds one spell bound. Besides being the adorning gem of the place, the lake offers ample opportunities of amusement for the holiday makers like boating, yachting, kayaking etc. The surface area of the lake is 48.76 hectares.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 11:07:08'),(80,'Bird’s eye view from Naina Peak','It is the most popular spot in Naini Tal. The soft cool air, the shade of the tall trees and the songs of the birds welcome you. Naina is the highest peak of the town and embraces an entire and spectacular view of Naini Tal town. The sparkling snow laden Himalaya can be seen in all their towering glory from this beautiful spot. One can catch the panoramic view of neighbouring towns, the glorious glimpses of the adjacent valleys and the endless stretch of the green brown plains appearing abruptly from the foot of the mountains and facing mysteriously into the blue horizon.\r\n(Content Courtesy- Ajay S. Rawat)',1,'2017-07-25 11:08:00'),(81,'Pancha Chuli from Cheena Peak','Beautiful view of Pancha Chuli from Cheena Peak/ Naina peak. Photo by Amit Sah',1,'2017-07-27 09:33:50'),(82,'Rope-Way','One of the most sought destinations for tourists in Nainital is the\r\nropeway, popularly known as Tourist’s Delight.’ It leads to Snow View,\r\nfamous for its spectacular Himalayan scenery and unveils a bird’s eye\r\nview of Naini Lake and the tantalising glimpses of its environs. The\r\njoyous ride to Snow View will recharge you and you will long to come\r\nback and immerse yourself in excitement. \r\nContent by Ajay S. Rawat',1,'2017-08-03 10:41:47'),(83,'Gurney House','It has long embraced the memories of Jim Corbett a legendary hunter,\r\nconservationist, writer and a highly realised soul. He was popularly\r\nknown as ‘White Sadhu’ by the villagers in Kumaon and the first\r\nEuropean to witness the divine lights emanating from the shrine of\r\nPurnagiri in total darkness. The incident happened in 1929 when he was\r\non a holy mission to relieve the villagers of the scourge of Talla Desh\r\nman-eater. Talla Desh is in present Champawat district and the divine\r\nlights which Jim has himself mentioned had a great impact on him. The\r\nsite for Gurney House was acquired by Jim Corbett’s mother Mary Jane\r\nCorbett in 1870 and Jim Corbett and her sister Maggie stayed there. It\r\nwas sold to Kalavati Verma in 1947. She was the sister of famous\r\nindustrialist and member of Governor General, Lord Wavell’s Council\r\nand married to Sharda Prasad Verma, who was the youngest barrister to\r\npass out from Cambridge. Kalavati’s credentials prompted Corbett to\r\nsell Gurney House to her; he was assured it was in safe hands and\r\nwould be well maintained. Currently it is in the possession of\r\nNilanjana Dalmia, the granddaughter of Kalawati and Sharda Prasad.\r\nGurney house is a great centre of Jim Corbett’s admirers and Nilanjana\r\nand her family are doing a yeoman service by keeping alive the legend\r\nof Jim Corbett. \r\nContent By Ajay S. Rawat',1,'2017-08-03 10:52:02'),(84,'Winter Reflection','Beautiful Naini Lake in winters. ',1,'2017-08-12 17:03:30');
