INSERT INTO `newsevents` VALUES (4,'About e-collectornainital.com','The purpose of creating this website is to ensure direct and easy access to all information related with revenue department. Revenue village section provides general information including Patwari details about all the revenue village. People can access information including details of next date of hearing for their revenue cases using Revenue court section and user can download any particular sheet of land map of a village in the revenue maps section. Places to visit section provides details with good photos of famous tourist places in the district. People can find department wise district level officer\'s details and contact numbers in the Who\'s Who section. Process of applying for various certificates and Details of CSCs can be seen in the downloads section.','x','Arial','03/08/2017','02:15:29pm',1,'dmnainital');
